import React,{Component} from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state={
      abc:[]
    }
  }
  componentDidMount(){
    fetch('/data')
    .then(res => res.json())
    .then(abc=>this.setState({abc},()=> console.log("adasd",abc)));
  }
  render(){
  return (
      <div>
        <Form.Label>Email address</Form.Label>
        <Form.Control type="email" placeholder="Enter email" />

      </div>
  );
}}

export default App;
